import './Page.css'

import { Container } from "react-bootstrap";

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { } from '@fortawesome/free-solid-svg-icons'

function Page(){
    return(
        <div className='wrapper black'>
            <Container fluid>
                <h1 className='title'>Page Views</h1>
            </Container>
        </div>
    )
}

export default Page
